Wonder Women

Culture Documentary hosted by Kristy Flanagan, published by PBS broadcasted as part of PBS Independent Lens series in 2013 - English narration


Information
------------------------------

WONDER WOMEN! THE UNTOLD STORY OF AMERICAN SUPERHEROINES traces the fascinating evolution and legacy of Wonder Woman. From the birth of the comic book superheroine in the 1940s to the blockbusters of today, WONDER WOMEN! looks at how popular representations of powerful women often reflect society's anxieties about women's liberation.

Go behind the scenes with Lynda Carter, Lindsay Wagner, comic writers and artists, and real-life superheroines such as Gloria Steinem, Kathleen Hanna and others, who offer an enlightening and entertaining counterpoint to the male-dominated superhero genre.

